import React from "react";
import { Box, ThemeProvider, createTheme, Grid, makeStyles } from "@mui/material";

import { Header, Playlist, AudioPlayer } from "./components";
import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <div style={{margin: 0, padding: 0, height: "vh", boxSizing: "border-box"}}>
      <ThemeProvider theme={darkTheme}>
        <CssBaseline />
        <Box sx={{height: "100%", boxSizing: "border-box"}}>
          <Header></Header>
          <Grid container sx={{height: "100%"}}>
            <Grid xs={6}>
              <Playlist></Playlist>
            </Grid>
            <Grid xs={6}>
              <AudioPlayer></AudioPlayer>
            </Grid>
          </Grid>
        </Box>
      </ThemeProvider>
    </div>
  );
}

export default App;
